script: |
  super -f text -I q10014.spq | sort > q10014.out

inputs:
  - name: q10014.spq
    data: |
      SELECT DISTINCT - 7 / col2 + + col1 * + col2 + + + col2 + 3 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - 25 NOT BETWEEN - col0 - col0 AND ( + CAST ( NULL AS REAL ) );
  - name: tab1

outputs:
  - name: q10014.out
    data: |
